import React, { Component } from 'react';
import TreeMenu from 'react-simple-tree-menu';
import '../node_modules/react-simple-tree-menu/dist/main.css';

class Menu extends Component {
    constructor(props) {
        super(props);
        this.state = {
            habilitation: [
                {
                    key: 'first-level-node-1',
                    label: 'Habilitation',
                    nodes: [
                        {
                            key: 'second-level-node-1',
                            label: 'Gestion role',
                        },
                        {
                            key: 'second-level-node-2',
                            label: 'Gestion utilisateur',
                        }
                    ],
                },
            ],
            scolarite: [
                {
                    key: 'first-level-node-2',
                    label: 'Scolarite',
                    nodes: [
                        {
                            key: 'second-level-node-1',
                            label: 'Matieres par formation',
                        },
                        {
                            key: 'second-level-node-2',
                            label: 'Papiers Apportées',
                        },
                        {
                            key: 'second-level-node-3',
                            label: 'Frais formation',
                        },
                        {
                            key: 'second-level-node-4',
                            label: 'Niveaux',
                        },
                        {
                            key: 'second-level-node-5',
                            label: 'Formations',
                        },
                        {
                            key: 'second-level-node-6',
                            label: 'Specialités',
                        },
                        {
                            key: 'second-level-node-7',
                            label: 'Matieres',
                        },
                        {
                            key: 'second-level-node-8',
                            label: 'Filiéres',
                        },
                        {
                            key: 'second-level-node-9',
                            label: 'Niveau de base',
                        },
                        {
                            key: 'second-level-node-10',
                            label: 'Type enseignement',
                        },
                    ],
                },
            ]
        }
    }

    render() {
        return (
            <div id="page-wrapper" style={{ minHeight: '263px', marginLeft: '0px' }}>
                <div className="container-fluid">
                    <div className="row bg-title">
                        <div className="col-lg-12">
                            <h4 className="page-title">Menu</h4>
                        </div>
                        {/* /.col-lg-12 */}
                    </div>
                    {/* /.row */}
                    <div class="row">
                        <div class="col-sm-12">
                            <div class="white-box">
                                <div class="row">
                                    <TreeMenu hasSearch={false} data={this.state.habilitation} />
                                    <TreeMenu hasSearch={false} data={this.state.scolarite} />
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Menu;
